import time
from typing import List


class Solution:
    def countPairs(self, deliciousness: List[int]) -> int:
        t1 = time.time()
        count = 0
        l = len(deliciousness)
        max_val = max(deliciousness)
        ind = 0
        power_two = []
        while True:
            v = 2 ** ind
            power_two.append(v)
            ind += 1
            if v >= 2 * max_val:
                break
        # print(power_two)
        for i in range(l):
            sum = deliciousness[i]
            for j in range(l - i - 1):
                if (sum + deliciousness[j + i + 1]) in power_two:
                    count += 1
        t2 = time.time()
        print("Total time: {} seconds".format(t2 - t1))
        return count


